import React, {useEffect, useState} from "react";
import {User} from "./User";
interface IProps {}
interface IState {
    users : User[]
}

let UserList:React.FC<IProps> =() =>{
    let[userState,setUserState] = useState<IState>({
        users : [] as User[]
    });

    useEffect(() =>{
        let dataURL: string = 'https://jsonplaceholder.typicode.com/users';
        let axios;
        axios.get(dataURL).then((response) => {
            setUserState({
                users : response.data
            });
        }).catch((error) => {
            console.error(error);
        });
    });
    return(
        <React.Fragment>
            <h2> UserList Components</h2>

        </React.Fragment>
    )
};
export default UserList;
